import React from "react";
import { Link } from "react-router-dom";

function Header() {
    const handleNavigation = (path) => {
        window.location.href = path; // Redirect to the specified path
    };

    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    <li><Link to="/">Home</Link></li>
                    <li><span onClick={() => handleNavigation("/about")}>Про клуб</span></li>
                    <li><span onClick={() => handleNavigation("/team")}>Основна команда</span></li>
                    <li><span onClick={() => handleNavigation("/youth")}>Молодіжна команда</span></li>
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

export default Header;
